const Shop = () => {
	const dispatch = useDispatch();

	useEffect(() => {
    dispatch(getProducts());
  }, [dispatch]);
    return(
        <div>
            <p>Soy la tienda</p>
            {/* <Filters /> */}
            <div>
        <ul className="card_grid">
          
              <Products
                id={el._id}
                name={el.nombre}
                image={el.foto}
                key={el.id}
              />
        </ul>
      </div>
        </div>
    )

}

export default Shop;
